description:
I continue to be inspired by combos of blues, greens and melons. I plan to incorporate it into jewelry, makeup and clothing this year!

This latest Nova set incorporates my favorite color combo
and a variety of textures and shapes to create a stunning look.

One of a kind, custom made to order. Please leave your wrist size at checkout, or contact us after the sale. 
***Your bracelets will not ship until I receive a size.

Stats:

3 Czech glass stones, in coral, on vintage brass chain;

1 malachite | lapis | brass focal bead, surrounded by beautiful plated figaro chain; 

Cow bone on beaded wire, accented by African brass, old turquoise & a batik bead;
